    false,nt"url": null,nt"notes": "This project will continue and improve
    upon an adaptive management project funded under a large Volunteers and Weeds Grant
    received in 2008 to identify the best course of action to control invasive plant
    species and restore native plant communities within the prairies of the Channeled
    Scablands. Restoration and protection of native plant diversity on Refuge Palouse
    Prairie remnants is a goal stated in the Refuge Comprehensive Conservation Plan.
    Specifically the objectives of this project are:1) Develop and complete a graduate
    level research project that includes replicated treatment strategies utilizing varying
    combinations of chemical, mechanical and biological control of invasive species
    and the restoration of native plant species characteristic of the Palouse Prairie
    Province through various cultural means.2) Evaluate treatment strategies for their
    efficacy in achieving restoration objectives and provide recommendations for future
    restoration efforts in a final written report.",nt"license_title": "License
